import React from "react";

const success=()=>{
    return(
        <div style={{border:'2px solidblack',borderRadius:'5px',boxShadow:'2px 2px 2px 2px',}}>
            <h2>SuccessFully Ordered</h2>
            <h3>Thank You for Buying our Product</h3>
            <h2>
                Your Order will be delivered in 2-days. 
            </h2>
        </div>
    )
}
export default success;
